    const db = await dbConnect();

    try {
        await db.collection('user').insertOne(userData);
        console.log('Korisnik uspjeno registriran.');
    } catch (error) {
        console.error('Dolo je do pogreke prilikom registracije korisnika:', error);
        throw error;
    }
};

